window.bookSummaryJSON = "<p><b>The long-awaited follow-up to </b><b><i>Voyager: Architects of Infinity</i></b><b> from the </b><b><i>New York Times</i></b><b> best-selling author and cocreator of </b><b><i>Star Trek: Picard</i></b><b>! </b></p> <p>As the crew of the Full Circle fleet works to determine the fate of their lost ship, the <i>Galen</i>, a struggle for survival begins at the far edge of the galaxy. New revelations about Species 001, the race that built the biodomes that first drew the fleet to investigate planet DK-1116, force Admiral Kathryn Janeway to risk everything to learn the truth.</p>"; 
